import  "../Layout/layout.css";
const Layout = ({children}) => (
    <div className="body">
        <div className="header">
            <img src="https://p.w3layouts.com/demos/coffee_shop/web/images/logo.png"  />

        </div>
        
        {children}
    </div>
)
export default Layout;
